import React from "react";
import Home from './components/Pages/Home/Home.js'
import About from './components/Pages/About/About.js'
const RouteLinks = [
  {
    path: "/",
    component: Home
  },
  {
    path: "/sandwiches",
    component: About
  },
];


export default RouteLinks;
